import React from 'react';

const ProgressBar = ({backgroundColor,progress,height}) => {

    const Parentdiv = {
        height: height,
        width: '85%',
        backgroundColor: 'whitesmoke',
        borderRadius: 40,
        margin: 20,

      }

      const Childdiv = {
        bottom: 3,
        height: '65%',
        width: `${progress}%`,
        backgroundColor: backgroundColor,
       borderRadius:40,
        textAlign: 'center'
      }

      const progresstext = {
        padding: 10,
        color: 'black',
        fontWeight: 900,
        backgroundColor: 'transparent'
      }

    return (
    <div style={Parentdiv}>
      <div style={Childdiv}>
        <span style={progresstext}>{`${progress}%`}</span>
      </div>
    </div>
    )
}

export default ProgressBar;
